import React from 'react'

 const select = () => {
    return (
        <div>
             <label>Select Repeat Type</label>
            <select>
              <option value="none">none</option>
              <option value="daily">Daily</option>
              <option value="weekly">Weekly</option>
            </select>
        </div>
    )
}

export default select;
